        Sung, Pham, Le, Zieger & Nguyen, 2019, with first record of A. minutus from
        China (Anura, Ranidae)","description":"Based on the examination of specimens
        of Amolops minutus Orlov & Ho, 2007 and A. ottorum Pham, Sung, Pham, Le, Zieger
        & Nguyen, 2019, we found that there is no significant morphological difference
        between them. Phylogenetic analysis also showed that A. minutus and A. ottorum
        belong to the same taxon. In addition, we discovered the distribution of A.
        minutus in China.In this study, we provide the first molecular data of Amolops
        minutus and regard A. ottorum as a junior synonym of A. minutus. In addition,
